( function( window ) {

'use strict';

// class helper functions from bonzo https://github.com/ded/bonzo

function classReg( className ) {
  return new RegExp("(^|\\s+)" + className + "(\\s+|$)");
}

// classList support for class management
// altho to be fair, the api sucks because it won't accept multiple classes at once
var hasClass, addClass, removeClass;

if ( 'classList' in document.documentElement ) {
  hasClass = function( elem, c ) {
    return elem.classList.contains( c );
  };
  addClass = function( elem, c ) {
    elem.classList.add( c );
  };
  removeClass = function( elem, c ) {
    elem.classList.remove( c );
  };
}
else {
  hasClass = function( elem, c ) {
    return classReg( c ).test( elem.className );
  };
  addClass = function( elem, c ) {
    if ( !hasClass( elem, c ) ) {
      elem.className = elem.className + ' ' + c;
    }
  };
  removeClass = function( elem, c ) {
    elem.className = elem.className.replace( classReg( c ), ' ' );
  };
}

function toggleClass( elem, c ) {
  var fn = hasClass( elem, c ) ? removeClass : addClass;
  fn( elem, c );
}

var classie = {
  // full names
  hasClass: hasClass,
  addClass: addClass,
  removeClass: removeClass,
  toggleClass: toggleClass,
  // short names
  has: hasClass,
  add: addClass,
  remove: removeClass,
  toggle: toggleClass
};

// transport
if ( typeof define === 'function' && define.amd ) {
  // AMD
  define( classie );
} else {
  // browser global
  window.classie = classie;
}

})( window );



(function() {
	var triggerBttn = document.getElementById( 'trigger-overlay' ),
		overlay = document.querySelector( 'div.overlay' ),
		closeBttn = overlay.querySelector( '.overlay-close' );
		transEndEventNames = {
			'WebkitTransition': 'webkitTransitionEnd',
			'MozTransition': 'transitionend',
			'OTransition': 'oTransitionEnd',
			'msTransition': 'MSTransitionEnd',
			'transition': 'transitionend'
		},
		transEndEventName = transEndEventNames[ Modernizr.prefixed( 'transition' ) ],
		support = { transitions : Modernizr.csstransitions };

	function toggleOverlay() {
		if( classie.has( overlay, 'open' ) ) {
			classie.remove( overlay, 'open' );
			classie.add( overlay, 'close' );
			var onEndTransitionFn = function( ev ) {
				if( support.transitions ) {
					if( ev.propertyName !== 'visibility' ) return;
					this.removeEventListener( transEndEventName, onEndTransitionFn );
				}
				classie.remove( overlay, 'close' );
			};
			if( support.transitions ) {
				overlay.addEventListener( transEndEventName, onEndTransitionFn );
			}
			else {
				onEndTransitionFn();
			}
		}
		else if( !classie.has( overlay, 'close' ) ) {
			classie.add( overlay, 'open' );
		}
	}

	triggerBttn.addEventListener( 'click', toggleOverlay );
	closeBttn.addEventListener( 'click', toggleOverlay );
})();




























jQuery(document).ready(function($){

	$(function() {
	  $('.anchor-links li a[href*=#]:not([href=#])').click(function() {
	    if (location.pathname.replace(/^\//,'') == this.pathname.replace(/^\//,'') && location.hostname == this.hostname) {
	      var target = jQuery(this.hash);
	      target = target.length ? target : $('[name=' + this.hash.slice(1) +']');
	      if (target.length) {
	        $('html,body').animate({
	          scrollTop: target.offset().top - 100
	        }, 1000);
	        return false;
	      }
	    }
	  });
	});

	if ( $('body').hasClass('home') ) {
		$('li.home').addClass('current');
	}

	if ( $('body').hasClass('page-id-12') || $('body').hasClass('page-id-14') || $('body').hasClass('page-id-23') ) {
		$('li.services').addClass('current');
	}

	if ( $('body').hasClass('page-id-16') ) {
		$('li.about').addClass('current');
	}

	if ( $('body').hasClass('page-id-18') ) {
		$('li.contact').addClass('current');
	}

	// $('.slides').skippr({
	// 	transition: 'slide',
	// 	speed: 1000,
	// 	arrows: false,
	// 	autoPlay: true,
	// 	autoPlayDuration: 9000,
	// 	keyboardOnAlways: false
	// });




	var slidesWidth = $('.slides .slide').length * window.innerWidth;
	$('.slides').width(slidesWidth);
	var translate = {amount: 0};

	setInterval(function(){
		$('.slides').velocity({translateX: getTranslate(), translateZ: 0}, {duration: 1000, easing: 'easeOutQuart'});


	}, 5000);

	var getTranslate = function(){
		if ( -(translate.amount) > (window.innerWidth * ($('.slides .slide').length - 2) ) ) {
			translate.amount = 0;
		} else {
			translate.amount += -(window.innerWidth);
		}

		return translate.amount;
	}




	$('.input-box').focusin(function(){
		$(this).children('.form-icon').addClass('hover');
		$(this).addClass('hover');
	});
	$('.input-box').focusout(function(){
		$(this).children('.form-icon').removeClass('hover');
		$(this).removeClass('hover');
	});

	//player.vimeo.com/video/113434181?badge=0&color=642e8c&title=0&byline=0&portrait=0

	$('.play-button').click(function(){
		$('.video iframe').attr('src', '//player.vimeo.com/video/113434181?badge=0&color=642e8c&title=0&byline=0&portrait=0');
		$('.video iframe').css('display', 'block');
	});


});